import React from 'react';
import { Link } from 'react-router-dom';

export default function News() {
    return(
        <div className="fakeNews">
          <h1>Latest News</h1>
          <h3>Stocks, Bonds, Dividends: Working Boys</h3>
          <img src="http://localhost:8080/documents/20123/0/business+calls.jpg/114e5baf-0f60-48ec-e5e6-4aa78946fd0d?t=1644995107560" className="picture" alt="businesscalls" />
          <h4>Professor Hidgens</h4>
          <Link to="/details1">Read More</Link>
          <br/>
          <h3>Business. I Love Business</h3>
          <img src="http://localhost:8080/documents/20123/0/business.jpg/8dad8958-3039-844e-0b03-cca3a74419f7?t=1644994837767" className="picture" alt="business" />
          <h4>Sam Eagle</h4>
          <button>Read More</button>
          <br/>
          <h3>Money, Money, Money. Is It Actually Funny?</h3>
          <img src="http://localhost:8080/documents/20123/0/money+money.jpg/d2872cb5-3495-30a5-f2fe-c53fe4253ac2?t=1644995309836" className="picture" alt="moneymoney" />
          <h4>ABBA</h4>
          <button>Read More</button>
      </div>
    );
  };
